  return (
    <div className='px-8'>
        <h1 className='text-3xl text-white'>{title}</h1>
        <div >
            <div className='flex items-center'>
{
    movies.map((movie)=>{
        return (
            <MovieCard key={movie.id}/>
        )
    })
}
              
            </div>
        </div>
    </div>
  )
}
